import React from "react";
import Container from "@material-ui/core/container";

class index extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            events: []
        };
    }

    render() {
        return (
            <Container maxWidth="sm">
                hekko
                <style global jsx>{`
                    body {
                        background: black;
                    }
                `}</style>
            </Container>
        );
    }
}

export default index;
